import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Events from './components/Events'; // Import the Events component
import './App.css';

function App() {
  // Assume isAdmin is determined based on user authentication
  const [isAdmin, setIsAdmin] = useState(true); // Set isAdmin based on user role

  return (
    <div className="App">
      <header className="App-header">
        <h1>Event Management System</h1>
      </header>
      {/* Pass isAdmin as a prop to the Events component */}
      <Events isAdmin={isAdmin} />
    </div>
  );
}

export default App;
